style.css:
@-moz-document url-prefix("https://neal.fun/infinite-craft/") {
.container, .sidebar-inner, .item, .instance, .sidebar-discoveries, .sidebar-sort, .sidebar-input {
  background: hsl(0, 0%, 10%) !important;
  color: hsla(0, 0%, 100%, 0.5) !important;
}

svg > * {
  fill: hsla(0, 0%, 100%, 0.5) !important;
}

.site-title, .side-controls, .sidebar-controls img, .logo, .empty-sidebar img, .instruction img {
  filter: invert(1);
}

::-webkit-scrollbar {
    background: hsl(0, 0%, 10%) !important;
  	width: 10px;
}

::-webkit-scrollbar-thumb {
    background:  hsla(0, 0%, 100%, 0.5) !important;
  	border-radius: 10px
}
}
